async function apiCallWithRetry(url, options, maxRetries = 3) {
  for (let i = 0; i < maxRetries; i++) {
    try {
      const response = await fetch(url, options);
      
      if (!response.ok) {
        const error = await response.json();
        throw new Error(error.detail || 'API request failed');
      }
      
      return await response.json();
    } catch (error) {
      if (i === maxRetries - 1) throw error;
      
      // Exponential backoff
      await new Promise(resolve => 
        setTimeout(resolve, Math.pow(2, i) * 1000)
      );
    }
  }
}`}),h.jsx("h2",{className:"text-2xl font-semibold mt-8 mb-4",children:"Webhook Integration"}),h.jsx("p",{className:"text-gray-600 dark:text-slate-400 mb-4",children:"Business plan users can configure webhooks for real-time notifications:"}),h.jsx(d,{id:"webhooks",code:`// Configure webhook
